#nullable enable // autogenerated

using System.Collections.Generic;
using System.Xml;

namespace MVZ2.Metas
{
    public class DifficultyMetaList
    {
        public DifficultyMeta[] metas;

        public DifficultyMetaList(DifficultyMeta[] metas)
        {
            this.metas = metas;
        }

        public static DifficultyMetaList FromXmlNode(XmlNode node, string defaultNsp)
        {
            var resources = new List<DifficultyMeta>();
            for (int i = 0; i < node.ChildNodes.Count; i++)
            {
                var meta = DifficultyMeta.FromXmlNode(node.ChildNodes[i], defaultNsp);
                if (meta != null)
                {
                    resources.Add(meta);
                }
            }
            return new DifficultyMetaList(resources.ToArray());
        }
    }
}
